Hopworks is similar to:
 other retail companies in that it sells products to customers and provides services to customers. However, unlike other retail companies, it is not a public company and its stock is not traded on the New York Stock Exchange.

The company's shareholders may invest in the company's stock through the purchase of shares of its common stock. The purchase of shares of common stock may be made through a futures or exchange-traded product or through the purchase of a warrant. The purchase of shares of common stock is subject to the following restrictions:

• The purchase of shares of common stock may be made only through a futures or exchange-traded product or through the purchase of a warrant;

• The purchase of shares of common stock may not be made at the same time as or concurrently with any other transaction;

• The purchase of shares of common stock may be made only to persons who are not authorized to purchase shares of the common stock;

• The purchase of shares of common stock may not be made on the same day as, on the same basis as, or in the same amount or in the same quantity as any other transaction; and

• The purchase of shares of common stock may be made only after the expiration of a specified period of time.

